create sequence seq_cidade;

create table cidade (
	id				bigint not null constraint cidade_pkey primary key,
	codigo_ibge		bigint not null,
	nome       		varchar(255) not null,
	latitude		real,
	longitude		real,
	capital			boolean not null,
	pais_id      	bigint not null,
	uf_id      		bigint not null,
	user_create     bigint 		 not null,
	date_create		timestamp with time zone 	 not null,
	user_update     bigint,
	date_update		timestamp with time zone,
	CONSTRAINT cidade_pais_id_foreign FOREIGN KEY (pais_id) REFERENCES pais(id),
	CONSTRAINT cidade_uf_id_foreign FOREIGN KEY (uf_id) REFERENCES uf(id)
);

